import React from 'react';

const HeroCard = ({ 
  id, 
  superhero, 
  publisher, 
  alter_ego, 
  first_appearance, 
  characters}) => {
  return (
    <>
      {id} 
      {superhero} 
      {publisher} 
      {alter_ego} 
      {first_appearance} 
      {characters} 
    </>
  )}

export default HeroCard;
